import React from 'react';
import styled from 'styled-components';

const HeaderContainer = styled.div`
  width: 100%;
  height: 75px;
  background-color: #1363A8;
  box-shadow: 0px 3px 1px #0F5080;
`
const LogoContainer = styled.div`
  width: 90%;
`

const Header = () => {
  return (
    <HeaderContainer>
    </HeaderContainer>
  );
}

export default Header;
